import { React, useState } from 'react'
import DataTable from '../components/DataTable'
import Header from '../components/Header'

const SearchParties = () => {
	const [searchText, setSearchText] = useState('')
	const [tableData, setTableData] = useState([])

	const handleSearch = async () => {
		const url = 'ENDPOINT'
		const searchOption = {
			name: searchText,
		}
		const requestOptions = {
			method: 'POST',
			headers: { 'Content-Type': 'application/json' },
			body: JSON.stringify(searchOption),
		}

		try {
			const response = await fetch(url, requestOptions)
			if (!response.ok) {
				throw new Error('Login request failed.')
			}
			const data = await response.json()
		} catch (error) {
			console.error(error)
		}
	}

	const handleChange = event => {
		setSearchText(event.target.value)
	}

	return (
		<div>
			<Header />
			<div className='flex justify-center items-center mt-5'>
				<input
					type='text'
					value={searchText}
					onChange={handleChange}
					className='px-4 py-2 border border-gray-400 rounded-md mr-2 focus:outline-none focus:border-green-500'
				/>
				<button
					onClick={handleSearch}
					className='px-4 py-2 bg-green-500 text-white rounded-md focus:outline-none hover:bg-green-600'
				>
					Search
				</button>
			</div>
			<DataTable
				cellsName={['Name', 'Cost', 'Add Time', 'User Email', 'Image']}
				cellsData={[]}
			/>
		</div>
	)
}

export default SearchParties
